import React, { Component } from "react";

export class Ac extends Component {
  constructor() {
    super();
    this.state = {
      fullName: "Achref belhay",
      bio: "studying in go my code",
      profession: "Full stack Web developper",
    };
  }
  render() {
    return (
      <div>
        <button onClick={this.props.handleToggleVisibility}>
          {this.props.visibility ? this.state : ""}
        </button>
      </div>
    );
  }
}

export default Ac;
